Refactored file operation architecture.

 - simplified implementation of file copy to local operation;
 - made file operation common code easier to factorize;
 - made file operations as move-only value-semantic types;
 - fixed file example program to use the new file copy operation API;

The file example is used in documentation as a concrete working
program demonstrating the qiFile API usage.

