Refactored qi::File for imminent additions (C++11).

 - fixed "cancelled" typo;
 - rewrote some code to C++11 to be clearer and added some overriding
   checks;
 - small perf improvements with moves instead of copies;
 - failing to open a file result in an errored future, not canceled one;
 - factorized some code to prepare for incoming
   file operations additions;

